import { Formik, Field, Form } from "formik";
import { Box, TextField} from "@mui/material";

import React from 'react'

const StudentForm = ({student}) => {
    const {age, email, firstName, lastName, subjects} = student;
    return (
        <Box sx={{position: "relative", top: "150px", display:"flex", flexDirection:"column"}} spacing={2}>
                <div>
                <TextField sx={{m: 1}} required label="First name"  value={firstName}  />
                <TextField sx={{m: 1}} required label="Last name" value={lastName} />
                </div>
                <div>
                <TextField sx={{m: 1}} label="Age" value={age} focused/>
                </div>
                <div>
                {subjects && subjects.map((s, a) => <TextField sx={{m: 1}} value={s} label={`Subect ${a+1}`} />)}
                </div>
                <div>
                <TextField sx={{m: 1}} required value={email} label="Email" />
                </div>
            </Box>
    )
}

export default StudentForm
